import React, { Fragment } from 'react';
import { useParams } from 'react-router-dom';
Fragment

const NewQuote = () => {

    const params = useParams();
    return (
      <Fragment>
        <h1>New Quote Page</h1>
        <p>{params.quoteId}</p>
      </Fragment>
    );
}

export default NewQuote;
